المرأة التي لم تعد راضية عن أي شيء تقليدي  تستحق أن تجد جوهرة.. 
يستحق الرجل الشجاع والمخلص أن يُعْتَرف به ويحظى بحب امرأة شجاعة وروح جامحة.. 
