الرجل الذي يجعل حياته تحدي يستحق أن تحبه امرأة تدعم أحلامه.. 
المرأة التي تطمح إلى الأفضل تستحق أن يحبها رجل يشعر وكأنها فائزة.. 
الرجل الذي يعيش في الحاضر ويهتم بعقله يستحق أن تحتضنه امرأة تتأمل وتغني وتقفز.. 
المرأة التي تعيش مرتبطة بنور الإله في داخلها تستحق أن يعتني بها رجل يعرف اسرار الوحدة العظيمة وحقوق حريتها.. 
